import React from 'react';
import { useSelector } from 'react-redux';

const Userdashboard = () => {
    const userAuthenticated = useSelector(state => state.auth.userAuthenticated);


    return (
        <>
            {userAuthenticated ? (
                <h1>Userdashboard</h1>
            ) : (
                <h1>Unauthorized Access!</h1>
            )}
        </>
    );
}

export default Userdashboard
